import React from "react";
import StatsCourseListItem from "./item";

const publishedcourse_data = [
  {
    id: "1",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "2",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "3",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "4",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  },
  {
    id: "5",
    name: "User Experience1",
    topic: "Design",
    skill: "UX, DESIGN",
    start_count: 12,
    incomplete_count: 5,
    complete_count: 20
  }
];

function PublishedCourseList() {
  const publishedCourseList = publishedcourse_data.map(item => (
    <PublishedCourseListItem
      key={item.id}
      publishedCourseListItem={item}
    ></PublishedCourseListItem>
  ));
  return <div>{publishedCourseList}</div>;
}

export default PublishedCourseList;
